import React, {component} from 'react'; 
import 
{
  BrowserRouter as Router, Route, Switch, Redirect
} 
from 'react-router-dom'; 

//Pages
import MainPage from './pages/MainPage';
import Aktivities from './pages/Aktivities';
import Scanner from './pages/Scanner'

function App()  {
  return (
    
    <Router>
     <Switch>
      <Route exact path="/login" component = {MainPage}></Route>
      <Route path="/login/aktivities" component = {Aktivities}></Route>
      <Route path="/login/aktivities/scan" component = {Scanner}></Route>
      <Route path="/login/aktivities"></Route>
     </Switch>
    </Router>
  );
}

export default App;
